sources.styles/mixins/_flexbox.scss:
@use 'sass:map';

$flexmap: (
  start: flex-start,
  end: flex-end,
  around: space-around,
  between: space-between,
  evenly: space-evenly,
  stretch: stretch,
  center: center,
);

@function get-flex-value($key) {
  @return map.get($flexmap, $key);
}

@mixin flexbox($display: flex, $jc: center, $ai: center) {
  display: $display;
  justify-content: get-flex-value($jc);
  align-items: get-flex-value($ai);
}

sources.styles/mixins/_position.scss:
@mixin pos-center-x($type: absolute) {
  @if ($type == absolute or $type: fixed) {
    position: $type;
    left: 50%;
    transform: translateX(-50%);
  }
}

@mixin pos-center-y($type: absolute) {
  @if ($type == absolute or $type: fixed) {
    position: $type;
    top: 50%;
    transform: translateY(-50%);
  }
}

@mixin pos-center($type: absolute) {
  @if ($type == absolute or $type: fixed) {
    position: $type;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
  }
}

sources.styles/mixins/_set-img-size.scss:
@mixin set-img-size($w: false, $h: false, $x, $y, $url: false) {
  $main__imgs--url: "/assets/imgs/main__imgs/#{$url}";
  @if ($w != false) {
    width: $w;
  } @else {
    width: $md--breakpoint - 1;
  }
  @if ($h != false) {
    height: $h;
  } @else {
    height: $article__img--h;
  }

  @if ($url != false) {
    background: url($main__imgs--url);
  }

  background-size: $x $y;
  background-repeat: no-repeat;
  background-position: center center;
}

sources.styles/mixins/_reponsive.scss:
@mixin responsive($screen) {
  @if ($screen == "md") {
    @media screen and (min-width: $md--breakpoint) {
      @content;
    }
  }

  @if ($screen == "lg") {
    @media screen and (min-width: $lg--breakpoint) {
      @content;
    }
  }

  @if ($screen == "max-lg") {
    @media screen and (min-width: $article__grid-img--w--lg * 2) {
      @content;
    }
  }
}

